pub enum Referrer {

    /// `<same-origin URL>` value of referrer.
    SameOriginUrl(String),

    /// `about:client` value of referrer.
    AboutClient,

    /// `<empty string>` value of referrer.
    Empty,
}

pub enum FileChunk {

    /// Reading of chunks started. Equals **0%** progress.
    Started {
        /// Name of loaded file.
        name: String,
    },

    /// The next data chunk that read. Also provides a progress value.
    DataChunk {
        /// The chunk of binary data.
        data: Vec<u8>,
        /// The progress value in interval: `0 < progress <= 1`.
        progress: f32,
    },

    /// Reading of chunks finished. Equals **100%** progress.
    Finished,
}

pub enum Area {

    /// Use `localStorage` of a browser.
    Local,

    /// Use `sessionStorage` of a browser.
    Session,
}

pub enum WebSocketStatus {

    /// Fired when a websocket connection was opened.
    Opened,

    /// Fired when a websocket connection was closed.
    Closed,

    /// Fired when a websocket connection was failed.
    Error,
}
